import React from 'react';
import { useNavigate } from 'react-router-dom';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';

import { Swiper, SwiperSlide } from 'swiper/react';
import { Navigation, Pagination } from 'swiper/modules';

function LandingPage() {
  const navigate = useNavigate();

  return (
    <Swiper
      modules={[Navigation, Pagination]}
      navigation
      pagination={{ clickable: true }}
      className="w-full h-screen"
    >
      {/* Slide to Profile */}
      <SwiperSlide onClick={() => navigate('/profile')}>
        <div className="flex items-center justify-center h-full bg-blue-300 text-white text-2xl font-bold cursor-pointer">
          Go to Profile
        </div>
      </SwiperSlide>

      {/* Slide to To-Do List */}
      <SwiperSlide onClick={() => navigate('/todo')}>
        <div className="flex items-center justify-center h-full bg-green-300 text-white text-2xl font-bold cursor-pointer">
          Go to To-Do List
        </div>
      </SwiperSlide>
    </Swiper>
  );
}

export default LandingPage;
